import React from "react";

const SignIn = () => {
	return (
		<>
			<h1>Enter in your details</h1>
			Name
			<input type="text" />
			Booking Reference
			<input type="text" />
			Email
			<input type="text" />
			Password
			<input type="text" />
			Terms and Conditions
			<input type="checkbox" />
			<button onClick={() => props.setScreenMode(1)}>Create Account</button>
		</>
	);
};

export default SignIn;
